import logo from './logo.svg';
import './App.css';
import Profile from './Component01.js';
import {ProfileTest} from './Component01.js';
import TodoList from './Component02.js';
import ProfileTest01 from './Component03';
import PackingList from './Component04';

function App() {

    return (
        <>
            <section>
                <h1>Amazing scientists</h1>
                <Profile />
                <Profile />
                <Profile />
                <ProfileTest />
                <ProfileTest />
                <ProfileTest />
            </section>

            <TodoList />;

            <ProfileTest01 />;

            <PackingList />;
        </>

    );
}


export default App;
